import React from 'react';

const ResumeModel = ({ onClose }) => {
  return (
    <div className="model-overlay">
      <div className="model-window">
        <div className="title-bar">
          <button className="close" onClick={onClose}><span>Close</span></button>
          <div className="title">Resume</div>
        </div>
        <div className="window-pane">
          <iframe src="./public/Omer External June.pdf" title="Resume" style={{ width: '100%', height: '100%' }}></iframe>
        </div>
      </div>
    </div>
  );
};

export default ResumeModel;
